import { Container } from "@mui/system";
import React from "react";
import styled from "styled-components";

const Boxfox = styled.div`
  height: 30px;
  background-color: #faebd7;
  color: #000000;
`;

const Publication = () => {
  return (
    <Container>
      #1 brand with hottest deals for infants and kids. Free shipping on orders
      $100 and over.
    </Container>
  );
};

export default Publication;
